import React from "react";

function Transaction({date, description, category, amount, transactions, search}) {
  return (
    <>
    {transactions


.map((transaction) =>
    <tr key= {transaction.id}>
      <td>{transaction.date}</td>
      <td>{transaction.description}</td>
      <td>{category}</td>
      <td>{amount}</td>
    </tr>
    )}
    </>
  );
}

export default Transaction;
